</Demo><h4 id="自定义节点" tabindex="-1"><a class="header-anchor" href="#自定义节点" aria-hidden="true">#</a> 自定义节点</h4>
<p>节点和展开按钮支持自定义
使用<code v-pre>default</code>和<code v-pre>expand</code>插槽自定义字之书节点和展开按钮渲染内容
也可以通过<code v-pre>renderContent</code> 自定义节点渲染内容 使用<code v-pre>renderContent</code>指定渲染函数，该函数返回需要的节点区内容即可。 渲染函数的用法请参考 Vue 文档</p>
